let color = {};

let date = new Date(2020, 5, 5, 23);
date = date.getHours();

let greet = '';

if (date <= 1 & date > 12) {
    greet = 'Good Morning';
}
else if (date <=12 & date > 18) {
    greet = 'Good Evening';
}
else{
    greet = 'Good Night';
}



function Greet() {
    return (
        <p>{date}</p>
    );
}

export default Greet;
